INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-409.0, "カリン", 33, "2020/01/04 4:59:59", 0.0, "2019/12/20 5:00:00", 0.0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 33001, 190801, 1, 0, 3, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-409.0, "カリン", 33, "2020/01/04 4:59:59", 0.0, "2019/12/20 5:00:00", 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 33002, 190801, 1, 0, 4, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-409.0, "カリン", 34, "2020/01/10 11:59:59", 0.0, "2020/01/04 5:00:00", 0.0, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 34001, 190801, 1, 0, 5, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-409.0, "カリン", 34, "2020/01/10 11:59:59", 0.0, "2020/01/04 5:00:00", 0.0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 34002, 190801, 1, 0, 6, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-458.0, "ペコリーヌ", 38, "2030/12/17 14:59:59", 5.3, "2015/12/17 15:00:00", 0.0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 38001, 105801, 2, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-458.0, "ペコリーヌ", 38, "2030/12/17 14:59:59", 6.5, "2015/12/17 15:00:00", 0.0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 38002, 105801, 2, 0, 2, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (9999.0, "ペコリーヌ", 39, "2020/04/08 23:59:59", 0.0, "2020/04/01", 9999.0, "", 39005, 105801, 3, 0, 0, 0, 3);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-430.0, "カリン", 40, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 40001, 190801, 1, 0, 2, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "シェフィ", 41, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 41001, 106401, 1, 2104010, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "ペコリーヌ", 41, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 41002, 105801, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "キャル", 41, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 41003, 106001, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "コッコロ", 41, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 41004, 105901, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "コッコロ", 42, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42001, 105901, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "シェフィ", 42, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42002, 106401, 1, 2104010, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "ペコリーヌ", 42, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42003, 105801, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "キャル", 42, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 42004, 106001, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "ペコリーヌ", 43, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43001, 105801, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "コッコロ", 43, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002, 105901, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-363.0, "キャル", 43, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003, 106001, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "アメス", 44, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 43004, 123001, 1, 0, 1, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "アメス", 44, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005, 123001, 1, 0, 2, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-416.5, "アメス", 45, "2030/12/17 14:59:59", 5.79, "2015/12/17 15:00:00", 0.0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 43006, 123001, 2, 0, 3, 0, 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (-371.5, "アメス", 46, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00", 0.0, "はい、お疲れ様。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001, 123001, 1, 0, 1, 0, 1);
